    false,nt"url": null,nt"notes": "During late July through September 1987
    and June and July 1988 the U.S. Geological Survey (USGS) conducted four cruises
    to cover the U.S. Aleutian Arc Exclusive Economic Zone (EEZ) region. As in earlier
    EEZ reconnaissance surveys, the USGS utilized the GLORIA (Geological LOng-Range
    Inclined Asdic) sidescan-sonar system to complete the geologic mapping. The collected
    GLORIA data were processed and digitally mosaicked to produce continuous imagery
    of the sea-floor. Thirty-one digital mosaics of a 3 degree by 3 degree (or smaller)
    area with a 50-meter pixel resolution were completed for the U.S. Aleutian Arc Exclusive
    Economic Zone region.",nt"license_title": null,nt"extras": [{ntt"key":
